import React from 'react'

import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div>
      <div>28th March 2022</div>

      <div>
        <h2>Car insurance</h2>
        <div>Rs 11000</div>
      </div>

    </div>
  )
}

export default ExpenseItem
